    <>
      <h1>Note-taking application</h1>
      {getNotes.map(note => <Note content={note.content} />)}
    </>

  );
  /*
  -- notes (display them with useState)
  -- form with a button to the right
      -- handlechange on the form so it can be written.
      -- onclick to be something that's stored into a useState variable.
  */


};
export default App;
